class Pessoa:
    def __init__(self, nome: str):
        self.__nome = nome

    def __str__(self):
        return self.__nome

class Budega:
    def __init__(self, num_caixa: int):
        self.__caixa: list[Pessoa | None] = []
        for _ in range(num_caixa):
            self.__num_caixa.append(None)
        self.__espera: list[Pessoa] = []

    def __str__(self):
        return f"{self.__caixa}\n{self.__espera}"

pessoa = Pessoa("Pedro")
print(pessoa)

budega = Budega(5)
print(budega)
